import React from 'react';
import { Text, StyleSheet, Button, View, FlatList, SafeAreaView, TouchableOpacity, Image } from 'react-native';

const Display = () => {

    const pages = "https://i.ibb.co/J7mMmbR/one-piece-1003-1.jpg"

    return (

        <View style={styles.container}>
            <Image
                style={styles.page}
                source={{uri:pages}}
            />
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        backgroundColor: 'black',
        height: '50%',
        width: '70%',
    },
    page:{
        height: 100,
        width: 100,
    }
});

export default Display;
